import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import "swiper/css/effect-cards";

import 'swiper/css/pagination';
import 'swiper/css/navigation';

import { EffectCards } from 'swiper';

const Cards = () => {

    return (
        <div>
            <Swiper
                effect={"cards"}
                grabCursor={true}
                centeredSlides={true}
                loop={true}
                slidesPerView={'auto'}
                modules={[EffectCards]}
                className="swiper_container"
            >
                <SwiperSlide className='bg-white text-black'><div class="rounded overflow-hidden shadow-lg dark:shadow-gray-800">
                    <img
                        class="w-full"
                        src="https://images.unsplash.com/photo-1519681393784-d120267933ba?ixlib=rb-4.0.3&amp;ixid=MnwxMjA3fDB8MHxzZWFyY2h8Nnx8bW91bnRhaW5zfGVufDB8fDB8fA%3D%3D&amp;auto=format&amp;fit=crop&amp;w=800&amp;q=60"
                        alt="Mountain" />
                    <div class="px-6 py-4">
                        <div class="font-bold text-xl mb-2">Mountain</div>
                        <p class="text-gray-700 dark:text-gray-300 text-base">
                            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus
                            quia, Nonea! Maiores et perfe
                        </p>
                    </div>
                    
                </div>
                </SwiperSlide>
                <SwiperSlide className='bg-white text-black'>Slide 2</SwiperSlide>
                <SwiperSlide className='bg-white text-black'>Slide 3</SwiperSlide>

            </Swiper>
        </div>
    )
}

export default Cards
